import classes from "./ProductSlider.module.scss";

const ProductSlider = () => {
  return (
    <section>
      <div className={classes.title}>
        <h1>Product Name</h1>
      </div>
      <div>Slider</div>
    </section>
  );
};

export default ProductSlider;
